from the @endrapeoncampus website: "the department of education (ed) has released its proposed rule on how schools handle cases of sexual violence. if the proposed rule becomes law, survivors will lose access to their education and schools will continue to sweep sexual violence under the rug. the new rule will stop survivors from coming forward and make schools more dangerous for all students." visit their site before january 28 to submit a comment, using the customizable template and easy-to-understand breakdowns of the proposed rules, impact, and associated data. your voice counts - make it heard.

